import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import { ContextGlobal } from './Components/utils/global.context';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <ContextGlobal>
    <BrowserRouter>
        <App/>
      </BrowserRouter>
    </ContextGlobal>
);
